import React, { useState } from "react";
import NavBar from "../NavBar";
import RecreationAPI from "../apis/RecreationApi";

const Book = ({ token, setToken }) => {
  const [reservationId, setReservationId] = useState(null);

  const createReservation = async () => {
    const api = new RecreationAPI("your_api_key_here");
    const activityId = "1234"; // replace with the ID of the activity to reserve
    const startDate = "2023-06-01";
    const endDate = "2023-06-05";
    const numberOfPeople = 2;
    const payment = {
      CreditCard: {
        CardType: "Visa",
        CardNumber: "4111111111111111",
        ExpirationDate: "2022-12-31",
      },
    };
    const reservation = await api.createReservation(
      activityId,
      startDate,
      endDate,
      numberOfPeople,
      payment
    );
    console.log(reservation);
    setReservationId(reservation.ReservationID);
  };

  return (
    <div id="book-container">
      <NavBar token={token} setToken={setToken} />
      <h1>Book</h1>
      <button onClick={createReservation}>Create Reservation</button>
      {reservationId && (
        <p>Reservation created with ID: {reservationId}</p>
      )}
    </div>
  );
};

export default Book;
